export default class Realtime{

    constructor(store){
        this.store = store;
        this.ws = null;
        this.isConnected = false;
        this.connect();

    }
    connect(){
        console.log("Helllo");
        // const store = store;
        this.ws = new WebSocket('ws://localhost:8080/', {
            origin: 'http://localhost:8080'
          });
    }
}
